import Counter from './Counter/Square'
import Header from './Header'

function App() {
    return (
        <div className="App container">
            <div className="row">
                <div className="card col-12">
                    <div className="card-body">
                        <Header />
                        <Square />
                    </div>
                </div>
            </div>
        </div>
    );
}

export default App;
